import {Box, keyframes, Typography} from "@mui/material";
import {useState} from "react";

export default function Projects() {
    const bounce = keyframes`
  from {
    opacity: 1;
    transform: scale(1);
  }

  to {
    opacity: 0;
    transform: scale(2);
  }
`;
    const [selected, setSelected] = useState<number>(0);
    return (
        <Box
            id={"projects"}
            sx={{
                marginTop: 10,
                minWidth: "50%",
                maxWidth: "70%",
            }}>
            <Box>
                <Typography variant={"subtitle1"}>
                    <span className={"green"}>02.</span>Projects
                </Typography>
            </Box>
            <Box sx={{display: "flex", width: 800}}>
                <Box sx={{width: "30%"}}>
                    <Box
                        onClick={() => {
                            setSelected(0)
                        }}
                        sx={{
                            transition: "border-width 0.2s linear",
                            cursor: "pointer",
                            borderLeft: (selected == 0) ? ("2px solid black") : "",
                            paddingLeft: (selected == 0) ? "1rem" : "",
                            @keyframes myanim: "{}"
                        }}>
                        <Typography variant="body1">
                            Product Design:
                        </Typography>
                        <Typography variant="body1">
                            Winno
                        </Typography>
                    </Box>
                    <Box
                        onClick={() => {
                            setSelected(1)
                        }}
                        sx={{
                            cursor: "pointer",
                            boxShadow: (selected == 1) ? ("-5px 0px 0px 0px black") : "",
                            paddingLeft: (selected == 1) ? "1rem" : ""
                        }}>
                        <Typography variant="body1">
                            Responsive Redesign:
                        </Typography>
                        <Typography variant="body1">
                            Poshmark
                        </Typography>
                    </Box>
                    <Box>
                        <Typography variant="body1">
                            Chrome Extension Dev:
                        </Typography>
                        <Typography variant="body1">
                            Sift
                        </Typography>
                    </Box>
                </Box>
                <Box sx={{width: "70%"}}>
                    am
                </Box>
            </Box>
        </Box>
    )
}
